import React, { Component } from 'react'


class PartnerSignUp extends Component {

    state = {
        id: "",
        password: "",
        email: "",
        name: "",
        address: " ",
        description: "",
        about: "",
        sustainablePractices: "",
        foodReviews:[],
        sustainabilityReviews:[],
        averageFoodRating: 0,
        location: {
            lat: 0,
            lng: 0,
        },
        website: "",
        phone: "",
        averageSustainabilityRating: 0,
        typeOfRewards: [],
        photos: "",
    }


    handleChange = () => {
        this.setState({
            username: this.refs.usernameIN.value,
            password: this.refs.passwordIN.value,
        })
    }

    render() {
        return (
            <div>
                <div>
                    <label>Restaurant ID: </label>
                    <input />
                </div>

            </div>
        )
    }
}
